import React from "react";
import ReactDOM from "react-dom"
import "../styles/components-style/Values.css"
import arrow from "../assets/arrowDropdown.png"

function Values ({title, text}) {
return (
    <div className="containerValue">
        <div className="dropdown" onClick={handleClick}>
        <h2 className="valueTitle">{title}</h2>
        <div className="arrowIcon"><img src={arrow} alt="fleche de dropdown" /></div>
        </div>
        <div className="descriptionValue hidden">
        <p className="valueText">{text}</p>
        </div>
    </div>
)
}

function handleClick(e){
 console.log("hello")
 console.log(e.target.current)
 const node = ReactDOM.findDOMNode(this)
 if (node instanceof HTMLElement) {
    const child = document.querySelector('.descriptionValue');
    console.log(child)
}
console.log(node)

}

export default Values;
